// O(n) time | O(1) space
function multiply(num1, num2) {
  let smaller = num1 < num2 ? num1 : num2;
  let bigger = num1 < num2 ? num2 : num1;
  return multiplyHelper(smaller, bigger);
}

function multiplyHelper(smaller, bigger) {
  if (smaller === 0) {
    return 0;
  } else if (smaller === 1) {
    return bigger;
  }
  let s = smaller >> 1;
  let side1 = multiplyHelper(s, bigger);
  let side2 = side1;
  if (smaller % 2 === 1) {
    side2 = multiplyHelper(smaller - s, bigger);
  }
  return side1 + side2;
}

// Solution #2
// O(n) time | O(n) space
function multiply(num1, num2) {
  let smaller = num1 < num2 ? num1 : num2;
  let bigger = num1 < num2 ? num2 : num1;
  let memo = {};
  return multiplyHelper(smaller, bigger, memo);
}

function multiplyHelper(smaller, bigger, memo) {
  if (smaller === 0) {
    return 0;
  } else if (smaller === 1) {
    return bigger;
  } else if (memo[smaller]) {
    return memo[smaller];
  }
  let s = smaller >> 1;
  let side1 = multiplyHelper(s, bigger, memo);
  let side2 = side1;
  if (smaller % 2 === 1) {
    side2 = multiplyHelper(smaller - s, bigger, memo);
  }
  memo[smaller] = side1 + side2;
  return memo[smaller];
}

